DROP TABLE products;

CREATE TABLE products (
  product_sku      SERIAL PRIMARY KEY,
  product_name     VARCHAR (200),
  product_tags     JSON,
  product_image    TEXT,
  product_thumbs   JSON,
  product_desc     VARCHAR(8000),
  product_type     VARCHAR(100),
  product_price    FLOAT,
  product_sale     FLOAT,
  product_shipping FLOAT,
  o1               TEXT
);

